import React, { useState, useEffect } from 'react'

//data
import { data } from './../data'

//components
import FunctionIcon from './FunctionIcon';
import Cross from './Cross'

const FunctionUI = ({ leng, setDisplay, display }) => {

    // const [display, setDisplay] = useState(true);

    // useEffect(() => {
    //     setTimeout(() => {
    //         setDisplay(false)
    //     }, 10000)
    // }, [])

    return (
        <div
            className="function-container"
            style={{
                display: !display && "none" 
            }} >
            <div className="func-description">
                {data[leng].function.description[0]}<br/>
                {data[leng].function.description[1]}
                <FunctionIcon />
                {data[leng].function.description[2]}<br/>
                {data[leng].function.description[3]}
            </div>
            <div className= "function">{data[leng].function.function}</div>
            <button
                onClick={() => setDisplay(false)}>
                <Cross />
            </button>
        </div>
    )
}

export default FunctionUI;
